											<p class="fs-14 line-24">
											Minerva holds a valid FTWZ Unit allotment from Ministry of Commerce and Trading under Chennai MEPZ jurisdiction authority to operate consolidation and LCL services for various trading and manufacturing units through our allotted FTWZ unit of 100,000 Sq. Ft warehouse located in “J. Matadee Free Trade Zone, Mannur, Chennai, Tamil Nadu, India”. A splendid feature of our free trade zone unit is the close proximity to the Chennai seaport and Chennai Airport, which are 38 km and 36 km respectively. The unit is also in very close proximity to the Bangalore and the Hyderabad National highways, easing the process of multi-country consolidation. Having a Pan India presence and holding a similar setup in Singapore, enables us to better connect with our patrons present in the global market.<br><br>
       With the rate of increase in movement of goods across the globe, we currently have our direct presence in all major cities in India. We are currently in the process of setting our teams and offices in strategic locations globally such as in Singapore, Dubai & London. Our expertise includes all industrial sectors, with services ranging from domestic and international to LCL to FCL, as well as managing inbound/outbound logistics, air & ocean shipments, Customs Clearance, Surface Transportation etc. We provide timely delivery of materials avoiding any delays in our customer’s supply chain. Our expertise includes handling the freight in multi-country consolidation and performing the required value-added services and re-exporting the products again to various destinations worldwide.
 


											
